// Navbar.js
import React from 'react';
import { ChakraProvider, CSSReset, Box, Flex, Link, Spacer, Image } from '@chakra-ui/react';

const Navbar = () => {
  return (
    <ChakraProvider>
      <CSSReset />
      <Box bg="blue.500" p={4} h={84}>
        <Flex align="center" justify="center">
          <Image src='/img/TPRGogoIcon.png'alt="Logo" boxSize="70px" objectFit="contain" mr={4} justify="center"/>

        
          <Spacer />
          <Link href="#" color="white" mr={4} justify="center">
            Home
          </Link>
          <Link href="#" color="white" mr={4} justify="center">
            About
          </Link>
          <Link href="#" color="white" mr={4} justify="center">
            Services
          </Link>
          <Link href="#" color="white" justify="center">
            Contact
          </Link>
        </Flex>
      </Box>
    </ChakraProvider>
  );
};

export default Navbar;
